// src/components/Home.js (asegúrate de que tenga esto)
import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home({ onLogout }) {
  const navigate = useNavigate();

  const handleLogoutClick = () => {
    onLogout(); // Llama a la función de logout de App.js
    navigate('/login'); // Redirecciona al login
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-green-100 p-4">
      <h1 className="text-4xl font-bold text-green-800 mb-4">Bienvenido al Panel ITAM</h1>
      <p className="text-lg text-gray-700 mb-6">Estás logueado.</p>
      <div className="flex space-x-4"> {/* Contenedor para los botones */}
        <button
          onClick={handleLogoutClick}
          className="px-6 py-3 bg-red-500 text-white rounded-lg shadow-md hover:bg-red-600 transition duration-300"
        >
          Cerrar Sesión
        </button>
        <button
          onClick={() => navigate('/users')}
          className="px-6 py-3 bg-blue-500 text-white rounded-lg shadow-md hover:bg-blue-600 transition duration-300"
        >
          Ir a Gestión de Usuarios
        </button>
      </div>
    </div>
  );
}

export default Home;
